import React, { useState } from 'react';
import SearchFilter from './SearchFilter';
import ServiceList from './ServiceList';

const App = () => {
  const [services, setServices] = useState([
    { id: 1, name: 'Service 1', category: 'Category 1', rating: 4 },
    { id: 2, name: 'Service 2', category: 'Category 2', rating: 3 },
    { id: 3, name: 'Service 3', category: 'Category 1', rating: 5 },
    // Add more services as needed
  ]);

  const handleFilter = (filterValue) => {
    // Implement filtering logic here if necessary
    console.log('Filtering with value:', filterValue);
  };

  const handleDeleteService = (id) => {
    // Delete the service with the given id
    const updatedServices = services.filter(service => service.id !== id);
    setServices(updatedServices);
  };

  const handleLogout = () => {
    // Implement logout logic here
    console.log('Logged out successfully!!');
  };

  return (
    <div className="container mx-auto px-4">
      <SearchFilter
        services={services}
        onFilter={handleFilter}
        onDeleteService={handleDeleteService}
        onLogout={handleLogout}
      />
      <ServiceList services={services} onDeleteService={handleDeleteService} />
    </div>
  );
};

export default App;
